// File: BabyFarm.sol

pragma solidity ^0.8.0;

contract BabyFarm is IERC20, Ownable {
    using SafeMath for uint256;

    string private _name = "Baby Farm";
    string private _symbol = "BabyFarm";
    uint8 private _decimals = 18;

    mapping(address => uint256) internal _balances;
    mapping(address => mapping(address => uint256)) internal _allowances;

    uint256 internal _totalSupply = 100000000000 * 10 ** 18; // 100B supply

    mapping(address => bool) isExcludedFromFee;
    mapping(address => bool) public blackListed;

    uint256 public _buy = 500; //  5.00%
    uint256 public _sell = 500; // 5.0%
    address public taxReceiver = 0xA775917e13b9aeA6d2e98eA794Da0662864Cc627; // tax Receiver

    uint256 public _inbetweenFee_ = 0; // 0%
    uint256 public _buyTotal;
    uint256 public _sellTotal;
    uint256 public _inbetweenFeeTotal;

    constructor() {
        isExcludedFromFee[taxReceiver] = true;
        isExcludedFromFee[address(this)] = true;
        _balances[taxReceiver] = _totalSupply;

        emit Transfer(address(0), taxReceiver, _totalSupply);
    }

    function name() public view returns (string memory) {
        return _name;
    }

    function symbol() public view returns (string memory) {
        return _symbol;
    }

    function decimals() public view returns (uint8) {
        return _decimals;
    }

    function totalSupply() public view override returns (uint256) {
        return _totalSupply;
    }

    function balanceOf(address account) public view override returns (uint256) {
        return _balances[account];
    }

    function transfer(
        address recipient,
        uint256 amount
    ) public virtual override returns (bool) {
        _transfer(msg.sender, recipient, amount);
        return true;
    }

    function allowance(
        address owner,
        address spender
    ) public view override returns (uint256) {
        return _allowances[owner][spender];
    }

    function approve(
        address spender,
        uint256 amount
    ) public override returns (bool) {
        _approve(msg.sender, spender, amount);
        return true;
    }

    function transferFrom(
        address sender,
        address recipient,
        uint256 amount
    ) public virtual override returns (bool) {
        _transfer(sender, recipient, amount);
        _approve(
            sender,
            msg.sender,
            _allowances[sender][msg.sender].sub(
                amount,
                "ERC20: transfer amount exceeds allowance"
            )
        );
        return true;
    }

    function _approve(address owner, address spender, uint256 amount) private {
        require(owner != address(0), "ERC20: approve from the zero address");
        require(spender != address(0), "ERC20: approve to the zero address");

        _allowances[owner][spender] = amount;
        emit Approval(owner, spender, amount);
    }

    function _transfer(
        address sender,
        address recipient,
        uint256 amount
    ) private {
        require(
            !blackListed[sender],
            "You are blacklisted so you can not Transfer Gen tokens."
        );
        require(
            !blackListed[recipient],
            "blacklisted address canot be able to recieve Gen tokens."
        );
        require(sender != address(0), "ERC20: transfer from the zero address");
        require(recipient != address(0), "ERC20: transfer to the zero address");

        uint256 transferAmount = amount;

        if (isExcludedFromFee[sender] && isExcludedFromFee[recipient]) {
            transferAmount = amount;
        }
        if (!isExcludedFromFee[sender] && !isExcludedFromFee[recipient]) {
            transferAmount = betweenFee(sender, amount);
        }
        if (isExcludedFromFee[sender] && !isExcludedFromFee[recipient]) {
            transferAmount = BuyFee(sender, amount);
        }
        if (!isExcludedFromFee[sender] && isExcludedFromFee[recipient]) {
            transferAmount = SellFee(sender, amount);
        }

        _balances[sender] = _balances[sender].sub(amount);
        _balances[recipient] = _balances[recipient].add(transferAmount);

        emit Transfer(sender, recipient, transferAmount);
    }

    /** 
       This function deduct tax for buy transactions
     */
    function BuyFee(
        address account,
        uint256 amount /*, uint256 rate*/
    ) private returns (uint256) {
        uint256 transferAmount = amount;
        uint256 buyFee = amount.mul(_buy).div(10000);

        if (buyFee > 0) {
            transferAmount = transferAmount.sub(buyFee);
            _balances[address(taxReceiver)] = _balances[address(taxReceiver)]
                .add(buyFee);
            _buyTotal = _buyTotal.add(buyFee);
            emit Transfer(account, address(taxReceiver), buyFee);
        }
        return transferAmount;
    }

    /** 
       This function deduct tax for sell transactions

    */

    function SellFee(
        address account,
        uint256 amount
    ) private returns (uint256) {
        uint256 transferAmount = amount;
        uint256 sellFee = amount.mul(_sell).div(10000);

        if (sellFee > 0) {
            transferAmount = transferAmount.sub(sellFee);
            _balances[address(taxReceiver)] = _balances[address(taxReceiver)]
                .add(sellFee);
            _sellTotal = _sellTotal.add(sellFee);
            emit Transfer(account, address(taxReceiver), sellFee);
        }

        return transferAmount;
    }

    /** 
       This function deduct tax between transactions

    */

    function betweenFee(
        address account,
        uint256 amount
    ) private returns (uint256) {
        uint256 transferAmount = amount;

        uint256 _inbetweenFee = amount.mul(_inbetweenFee_).div(10000);

        if (_inbetweenFee > 0) {
            transferAmount = transferAmount.sub(_inbetweenFee);
            _balances[address(taxReceiver)] = _balances[address(taxReceiver)]
                .add(_inbetweenFee);
            _inbetweenFeeTotal = _inbetweenFeeTotal.add(_inbetweenFee);
            emit Transfer(account, address(taxReceiver), _inbetweenFee);
        }

        return transferAmount;
    }

    /**
      This function will be used for add any address in blacklist (if you want to block any address like bots etc)
    */

    function addInBlackList(address account, bool) public onlyOwner {
        blackListed[account] = true;
    }

    /**
     This function will be used for remove any address from blacklist 
    */
    function removeFromBlackList(address account, bool) public onlyOwner {
        blackListed[account] = false;
    }

    /** 
       This function will be used for checking any address in blacklist or not 
    */
    function isBlackListed(
        address _address
    ) public view returns (bool _blacklisted) {
        if (blackListed[_address] == true) {
            return true;
        } else {
            return false;
        }
    }
}
